import React from 'react'
import classes from './MovingLine.module.css'

const MovingLine = () => {
  return (
    <div className={classes.scrollingBanner}>
      <div className={classes.content}>
        <span><i classN="fa-solid fa-dumbbell"></i>KETTLEBELL</span>
        <span><i class="fa-solid fa-dumbbell"></i>JUMP ROPE</span>
        <span><i class="fa-solid fa-dumbbell"></i>MEDICINE BALL</span>
      </div>
    </div>
  )
}

export default MovingLine;
